class Solution {
    public int minOperations(int[] nums) {
        int[] freq = new int[1000001];
        for (int num : nums) {
            freq[num]++;
        }

        int operations = 0;
        int leftoverTwos = 0;
        for (int f : freq) {
            if (f == 0) continue;
            operations += f / 3;
            f %= 3;
            if (f == 2) {
                leftoverTwos++;
            } else if (f == 1) {
                if (leftoverTwos > 0) {
                    leftoverTwos--;
                    operations++;
                } else {
                    return -1;
                }
            }
        }

        if (leftoverTwos % 2 != 0) {
            return -1;
        }
        operations += leftoverTwos / 2;
        return operations;
    }
}
